import React, { Component } from 'react';
import styled from '@emotion/styled';

const navbarStyle = styled.nav`
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  color: black;
  font-weight: bold;
  &:hover {
    color: white;
  }
`

export default class Navbar extends Component {
    render() {
        return (
            <div>
                <navbarStyle>
                    <a>
                        Pokemon
                    </a>
                </navbarStyle>
            </div>
        )
    }
}
